import { Route, Switch } from 'react-router-dom';
import Home from "./components/index/Home";
import Weather from "./components/index/Weather";
import "./App.css";


function App() {
  return (
    <>
      <Home />
      <Switch>
        <Route path="/" component={<Home/>} />

        <Route path="/weather" component={<Weather/>} />

      </Switch>
    </>
  );
}

export default App;
